class Solution {
public:
    int numDifferentIntegers(string word) {
        int n = word.length();
        unordered_set<string>s;
        int i=0;
        while(i<n){
            if(isdigit(word[i]) == false){
                i++;
                continue;
            }
            string temp = "";
            // while the character is a digit, add it to the temp string
            while(i<n && isdigit(word[i])){
                temp += word[i];
                i++;
            }
            // remove the leading zeros from the temp string
            int j=0;
            while(j<temp.length() && temp[j] == '0') j++;
            temp = temp.substr(j);
            // insert the temp string into the set
            s.insert(temp);
        }
        // return the size of the set
        return s.size();
    }
};
```
